import React from "react";
import { data } from "../../utils/data";
import styles from "../../components/ConstructorElementBlocked/ConstructorElementBlocked.module.css";
import BurgerIngredient from "../BurgerIngredient/BurgerIngredient";
import {
  LockIcon,
  CurrencyIcon, ConstructorElement
} from "@ya.praktikum/react-developer-burger-ui-components";

function ConstructorElementBlocked({ image, name, price }) {
  return (
    <div className={styles.ConstructorElementBlocked}>
      <img
        src={image}
        alt="Ингредиент бургера"
        style={{ width: "80px", height: "40px", marginLeft: 24 }}
      />

      <h2 className={styles.ConstructorElementName} >{name} (верх)</h2>
      <p  style={{ display: "flex", alignItems: "center", margin: 0 }}>
        {price} <CurrencyIcon type="primary" />
      </p>
      <p><LockIcon type="primary" />
      </p>
    </div>
  );
}

export default ConstructorElementBlocked;
